import React from "react";
import { PageHeader, Form, Input, Card,  Cascader,
} from "antd";
import { StepPanel } from "./stepPanel";
const provinsi = [
    {
        "provinsi": [{ "id": 11, "value": "Aceh", "label": "Aceh" }, 
        { "id": 12, "value": "Sumatera Utara" , "value": "Sumatera Utara" }, 
        { "id": 13, "value": "Sumatera Barat", "value": "Sumatera Utara" }, 
        { "id": 14, "value": "Riau" , "value": "Sumatera Utara"}, 
        { "id": 15, "value": "Jambi" , "value": "Sumatera Utara"}, 
        { "id": 16, "value": "Sumatera Selatan", "value": "Sumatera Utara" }, 
        { "id": 17, "value": "Bengkulu", "value": "Sumatera Utara" }, 
        { "id": 18, "value": "Lampung", "value": "Sumatera Utara" }, 
        { "id": 19, "value": "Kepulauan Bangka Belitung", "value": "Kepulauan Bangka Belitung" }, 
        { "id": 21, "value": "Kepulauan Riau" , "value": "Kepulauan Riau"},
        { "id": 31, "value": "Dki Jakarta",  "value": "Dki Jakarta",
        "children": [
            { "id": 3101, "id_provinsi": "31", "value": "Kabupaten Kepulauan Seribu",
            "kecamatan":[
                {"id":3101010,"id_kota":"3101","nama":"Kepulauan Seribu Selatan"},
                {"id":3101020,"id_kota":"3101","nama":"Kepulauan Seribu Utara"}]
        }, 
            { "id": 3171, "id_provinsi": "31", "value": "Kota Jakarta Selatan",  
            "children" : [
                {"id":3171010,"id_kota":"3171","value":"Jagakarsa"},
                {"id":3171020,"id_kota":"3171","value":"Pasar Minggu"},
                {"id":3171030,"id_kota":"3171","value":"Cilandak"},
                {"id":3171040,"id_kota":"3171","value":"Pesanggrahan"},
                {"id":3171050,"id_kota":"3171","value":"Kebayoran Lama"},
                {"id":3171060,"id_kota":"3171","value":"Kebayoran Baru"},
                {"id":3171070,"id_kota":"3171","value":"Mampang Prapatan"},
                {"id":3171080,"id_kota":"3171","value":"Pancoran"},
                {"id":3171090,"id_kota":"3171","value":"Tebet"},
                {"id":3171100,"id_kota":"3171","value":"Setia Budi"}]}, 
            { "id": 3172, "id_provinsi": "31", "value": "Kota Jakarta Timur" }, 
            { "id": 3173, "id_provinsi": "31", "value": "Kota Jakarta Pusat" }, 
            { "id": 3174, "id_provinsi": "31", "value": "Kota Jakarta Barat" }, 
            { "id": 3175, "id_provinsi": "31", "value": "Kota Jakarta Utara" }]

        }, 
        { "id": 32, "value": "Jawa Barat" }, 
        { "id": 33, "value": "Jawa Tengah" }, 
        { "id": 34, "value": "Di Yogyakarta" }, 
        { "id": 35, "value": "Jawa Timur" }, 
        { "id": 36, "value": "Banten" }, 
        { "id": 51, "value": "Bali" }, 
        { "id": 52, "value": "Nusa Tenggara Barat" }, 
        { "id": 53, "value": "Nusa Tenggara Timur" }, 
        { "id": 61, "value": "Kalimantan Barat" }, 
        { "id": 62, "value": "Kalimantan Tengah" }, 
        { "id": 63, "value": "Kalimantan Selatan" }, 
        { "id": 64, "value": "Kalimantan Timur" }, 
        { "id": 65, "value": "Kalimantan Utara" }, 
        { "id": 71, "value": "Sulawesi Utara" }, 
        { "id": 72, "value": "Sulawesi Tengah" }, 
        { "id": 73, "value": "Sulawesi Selatan" }, 
        { "id": 74, "value": "Sulawesi Tenggara" }, 
        { "id": 75, "value": "Gorontalo" }, 
        { "id": 76, "value": "Sulawesi Barat" }, 
        { "id": 81, "value": "Maluku" }, 
        { "id": 82, "value": "Maluku Utara" }, 
        { "id": 91, "value": "Papua Barat" }, 
        { "id": 94, "value": "Papua" }]
    }
]
function MyStepForm() {
  const [stepForm] = Form.useForm();
  const {data} = require('./kelurahan');
  console.log(data.kelurahan)

  const Step1Form = () => {
    return (
      <>
        <Form.Item
        style={{margin : "40px"}}
        name="field1"
        label="Merchant ID"
        rules={[
        //   {
        //     type: 'email',
        //     message: 'The input is not valid E-mail!',
        //   },
          {
            required: true,
            message: 'IMEI atau id dari POS APP',
          },
        ]}
      >
        <Input placeholder="IMEI atau id dari POS APP" style={{width : "69%" ,margin:"0 0 0 10px"}} />
      </Form.Item>
      <Form.Item
        style={{margin : "40px"}}
        name="field2"
        label="Owner"
        rules={[
          {
            required: true,
            message: 'Nama owner dari usaha',
          },
        ]}
      >
        <Input placeholder="Nama Owner dari usaha" style={{width : "64%" ,margin:"0 0 0 45px"}}/>
      </Form.Item>
      <Form.Item
        style={{margin : "40px"}}
        name="field2"
        label="NIK"
        rules={[
          {
            required: true,
            message: 'Nomor Induk Kepegawaian',
          },
        ]}
      >
        <Input placeholder="Nomor Induk Kepegawaian" style={{width : "61%" ,margin:"0 0 0 65px"}} />
      </Form.Item>
      <Form.Item
        style={{margin : "40px"}}
        name="field2"
        label="Email"
        rules={[
          {
            required: true,
            message: 'someone@someplace.com',
          },
        ]}
      >
        <Input placeholder="someone@someplace.com"  style={{width : "63%" ,margin:"0 0 0 52px"}}/>
      </Form.Item>
      <Form.Item
        style={{margin : "40px"}}
        name="field2"
        label="Nama Usaha"
        rules={[
          {
            required: true,
            message: 'Brand dari usaha',
          },
        ]}
      >
        <Input placeholder="Brand dari usaha"  style={{width : "70%" ,margin:"0 0 0 3px"}}/>
      </Form.Item>
      </>
    );
  };

  const Step2Form = () => {
    return (
      <>
        <Form.Item
        style={{margin : "40px"}}
        name="field2"
        label="Owner"
        rules={[
          {
            required: true,
            message: 'Nama owner dari usaha',
          },
        ]}
      >
        <Input placeholder="Nama Owner dari usaha" />
      </Form.Item>

      <Form.Item
        name="field2"
        label="Provinsi / Kabupaten / Kota / Kecamatan"
        rules={[
          { type: 'array', required: true, message: 'Pilih Kelurahan yang ada' },
        ]}
      >
        <Cascader options={data.kelurahan} />
      </Form.Item>
      </>
    );
  };
  const Step3Form = () => {
    return (
      <>
        <Form.Item
        style={{margin : "40px"}}
        name="field1"
        label="Merchant ID"
        rules={[
        //   {
        //     type: 'email',
        //     message: 'The input is not valid E-mail!',
        //   },
